    data: |
      SELECT - col2 AS col2 FROM tab0 (FORMAT parquet) cor0 WHERE NOT + 88 NOT IN ( + ( - + col2 ), - col1 * + - col0 + - col2 + col1 * + 62 );
  - name: tab0

outputs:
  - name: q12505.out
    data: |
